import React from 'react';
import { Button, Container, Typography } from '@mui/material';

function App() {
  return (
    <Container maxWidth="sm">
      <Typography variant="h2" gutterBottom>
        AI Elephant Controller
      </Typography>
      <Button variant="contained" color="primary">
        Connect to Robot
      </Button>
    </Container>
  );
}

export default App;
